import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

// Example static data (replace with actual backend data)
const teamsData = [
  { name: "Team Alpha", description: "A team of experienced developers." },
  { name: "Team Beta", description: "A team of creative designers and developers." },
  { name: "Team Gamma", description: "A team working on AI-based projects." },
];

const membersData = [
  { name: "John Doe", skills: "JavaScript, React, Node.js" },
  { name: "Jane Smith", skills: "Python, AI, Machine Learning" },
  { name: "Sam Wilson", skills: "UI/UX Design, HTML, CSS" },
];

const hackathonsData = [
  { name: "Hackathon 2024", status: "Participating", time: "March 2024" },
  { name: "AI Challenge", status: "Participated", time: "June 2023" },
];

const achievementsData = [
  { title: "Winner of Codefest 2023", date: "January 2023" },
  { title: "Top 10 in Hackathon XYZ", date: "April 2022" },
];

const ProfilePage = () => {
  const navigate = useNavigate();
  const [teams, setTeams] = useState(teamsData);
  const [members, setMembers] = useState(membersData);
  const [hackathons, setHackathons] = useState(hackathonsData);
  const [achievements, setAchievements] = useState(achievementsData);
  const [activeSection, setActiveSection] = useState(null);
  const [searchTerm, setSearchTerm] = useState("");

  useEffect(() => {
    // Fetch data from the backend if needed
  }, []);

  const handleExploreTeams = () => setActiveSection("teams");
  const handleExploreMembers = () => setActiveSection("members");

  const handleSearch = (e) => setSearchTerm(e.target.value);

  const filteredTeams = teams.filter(team =>
    team.name.toLowerCase().includes(searchTerm.toLowerCase())
  );
  const filteredMembers = members.filter(member =>
    member.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // Styles
  const pageStyle = {
    background: "linear-gradient(135deg, #1a237e, #6a1b9a)",
    color: "#fff",
    minHeight: "100vh",
    padding: "20px",
    fontFamily: "Arial, sans-serif",
  };

  const sectionStyle = {
    marginBottom: "40px",
    padding: "20px",
    backgroundColor: "rgba(255, 255, 255, 0.1)",
    borderRadius: "10px",
    boxShadow: "0 4px 15px rgba(255, 255, 255, 0.3)",
    maxWidth: "800px",
    marginLeft: "auto",
    marginRight: "auto",
  };

  const scrollableBoxStyle = {
    maxHeight: "300px",
    overflowY: "auto",
    padding: "10px",
    borderRadius: "8px",
    backgroundColor: "rgba(0, 0, 0, 0.5)",
    boxShadow: "0 0 10px rgba(255, 255, 255, 0.5)",
  };

  const itemStyle = {
    marginBottom: "10px",
    padding: "15px",
    borderRadius: "8px",
    backgroundColor: "rgba(255, 255, 255, 0.2)",
    boxShadow: "0 0 5px rgba(255, 255, 255, 0.5)",
  };

  const searchBarStyle = {
    padding: "10px",
    fontSize: "14px",
    borderRadius: "5px",
    border: "1px solid #ddd",
    width: "100%",
    marginBottom: "20px",
  };

  const buttonStyle = {
    backgroundColor: "#6a1b9a",
    color: "#fff",
    padding: "10px 15px",
    fontSize: "14px",
    borderRadius: "5px",
    border: "none",
    cursor: "pointer",
    margin: "5px",
    boxShadow: "0px 4px 10px rgba(255, 255, 255, 0.5)",
  };

  return (
    <div style={pageStyle}>
      <header style={{ textAlign: "center", marginBottom: "40px" }}>
        <h1>SkillHunt</h1>
        <button style={buttonStyle} onClick={() => navigate('/login')}>
          Login / Sign Up
        </button>
      </header>

      {/* Achievements Section */}
      <div style={sectionStyle}>
        <h2>Achievements</h2>
        <div style={scrollableBoxStyle}>
          {achievements.map((achievement, index) => (
            <div style={itemStyle} key={index}>
              <h4>{achievement.title}</h4>
              <p>{achievement.date}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Hackathons Section */}
      <div style={sectionStyle}>
        <h2>Hackathons</h2>
        <div style={scrollableBoxStyle}>
          {hackathons.map((hackathon, index) => (
            <div style={itemStyle} key={index}>
              <h4>{hackathon.name}</h4>
              <p>Status: {hackathon.status}</p>
              <p>Time: {hackathon.time}</p>
            </div>
          ))}
        </div>
      </div>

      {/* Explore Section */}
      <div style={sectionStyle}>
        <h2>Explore</h2>
        <button style={buttonStyle} onClick={handleExploreTeams}>
          Explore Teams
        </button>
        <button style={buttonStyle} onClick={handleExploreMembers}>
          Explore Members
        </button>

        {/* Conditional Rendering */}
        {activeSection === "teams" && (
          <div style={{ marginTop: "20px" }}>
            <input
              type="text"
              placeholder="Search teams..."
              value={searchTerm}
              onChange={handleSearch}
              style={searchBarStyle}
            />
            <div style={scrollableBoxStyle}>
              {filteredTeams.map((team, index) => (
                <div style={itemStyle} key={index}>
                  <h4>{team.name}</h4>
                  <p>{team.description}</p>
                </div>
              ))}
            </div>
          </div>
        )}

        {activeSection === "members" && (
          <div style={{ marginTop: "20px" }}>
            <input
              type="text"
              placeholder="Search members..."
              value={searchTerm}
              onChange={handleSearch}
              style={searchBarStyle}
            />
            <div style={scrollableBoxStyle}>
              {filteredMembers.map((member, index) => (
                <div style={itemStyle} key={index}>
                  <h4>{member.name}</h4>
                  <p>Skills: {member.skills}</p>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default ProfilePage;
